    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    outlines Refuge accomplishments from May through August of 1942. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    grazing. The public relations section of the report describes recreational uses,
    Refuge participation, and fishing. N-R forms and photographs are attached.",nt"license_title":
